//SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0 <0.9.0;

contract Lottery{

    address public immutable manager;
    address payable[] public players;

    constructor(){
        manager = msg.sender;
        deleteAllPlayers();
    }

    receive() external payable{
        require(msg.value == 0.1 ether);
        players.push(payable(msg.sender));
    }

    fallback() external payable{
        revert();
    }

    function getBalance() public view returns(uint){
        require(msg.sender == manager);
        return address(this).balance;
    }

    function pickWinner() public{
        require(manager == msg.sender);
        require(players.length >= 3);
        
        uint rand = random() % players.length;
        address payable addr = players[rand];
            
        transferEthToWinner(addr, getBalance());
        deleteAllPlayers();
    }

    function transferEthToWinner(address payable recipient, uint amount) private{
        require(manager == msg.sender);

        recipient.transfer(amount);
    }

    // TODO: Improve random
    function random() public view returns(uint){
        return uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp, players.length)));
    }

    function deleteAllPlayers() private {
        uint j = players.length;
        for(uint i = 0; i<j; i++){
            players.pop();
        }
    }
}

